    false,nt"url": null,nt"notes": "The objectives of this project:nna) Identify
    the distribution of non-natives in the Columbia River Basinnnb) Highlight the impacts
    of non-natives on salmonidsnnc) Examine the impacts of specific predators/competitors
    with salmonidsnnd) Combine spatially explicit information on the mechanisms and
    magnitudes of impact to identify areas where risks to salmon are the greatest and
    where management strategies are needed to minimize non-native impacts. FTEs, postdoctoral
    researchers, and external collaborators are specifically focused on several key
    taxa (walleye, brook trout and smallmouth bass), the history of stocking in the
    Pacific NW, and effects of these nonnatives on populations and ecosystems.nnThis
    ongoing project produces peer reviewed manuscripts, and its audience is science
    researchers and management, including NOAA's Regional Office.nnDistribution of Non-Indigenous
    Species in the Pacific NW.",nt"license_title": null,nt"extras": [{ntt"key":
